var tipuesearch = {"pages": [{'title': 'dartpad練習', 'text': '', 'tags': '', 'url': 'dartpad練習.html'}, {'title': 'LOOP', 'text': 'gist： https://gist.github.com/s40523147/6d2424bc87af38805fdec83314c1c4e5 \n \n', 'tags': '', 'url': 'LOOP.html'}, {'title': 'HEIIO迴圈程式', 'text': 'gist： https://gist.github.com/s40523147/ae424fd04b56993f9f794ee20e7923df \n \n', 'tags': '', 'url': 'HEIIO迴圈程式.html'}, {'title': '亂數分組程式', 'text': 'gist： https://gist.github.com/s40523147/82fe0ed8701f8a97e06d735e693f1374 \n \n', 'tags': '', 'url': '亂數分組程式.html'}, {'title': '各周作業', 'text': '', 'tags': '', 'url': '各周作業.html'}, {'title': 'W2', 'text': '課程筆記 \n \n 隨身碟內資料 與 遠端倉儲 不一致 ， 可利用指令 git pull 合併兩者，再 add -> commit -> push 即可 \n Cmsimde 資料夾內如果沒東西的話 ， 可用指令 git submodule init -> git\xa0 submodule update \n 字幕影片轉換的指令\xa0\n ffmpeg -i 原影片名稱.mp4 -vf subtitles=字幕檔名稱.srt 轉出的影片名稱.mp4 \n \n LEO文章嵌入連結\xa0 <a href="網址">顯示的文字</a> \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': 'Dartpad引入Gist中的Dart程式 \n Dartpad 網址\xa0 https://dartpad.dartlang.org/?id=ae424fd04b56993f9f794ee20e7923df \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '', 'tags': '', 'url': 'W4.html'}, {'title': 'W6', 'text': '', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': 'gist： https://gist.github.com/s40523147/0c582bedde052709ae873163068d8157 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '課程筆記： \n 1 . slug 每篇文章不能相同 \n 2 . Leo 節點操作指令\xa0 \n ctrl + i\xa0 \xa0新增 \n ctrl + u\xa0 \xa0往上 \n ctrl + d\xa0 \xa0往下 \n ctrl + l\xa0 \xa0 往左 \n ctrl + r\xa0 \xa0往右 \n 2. Leo 提交方式 \n local - blog -> goto script\xa0 近端提交 \n \n github - blog ->\xa0 goto script\xa0 遠端提交 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W10', 'text': '參考老師給的網址： https://github.com/mdecourse/cad2019/issues/20 \n 1.\xa0 使用SSH推送更新的資訊至倉儲(可用中文方式提交推送) \n 2.\xa0 在小組Cmsimde網站中增加 溫度轉換的按鈕 以及 轉換之程式碼 \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '攝氏轉華氏： \n gist： https://gist.github.com/s40523147/fcbbc80a4d80b6671881e22fd01d0581 \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '華攝氏徵測轉換 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': '純 Dart 程式 \n 華攝氏徵測轉換 \n Html 程式 \n Temp2    內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '', 'tags': '', 'url': 'W15.html'}]};